import React from 'react';
import s from './App.module.css';
import { Header } from './Header/Header';


function App() {


  return (
    <div className={s.app}>
      <h1>Generate a secure password</h1>
      <div className={s.password}>
        <input placeholder='Generating....' />
      </div>
      <div className={s.settings}>
        <div className={s.passwordLength}>
          Password Length <input type="number" size="3" name="num" min="1" max="25" value="1" />
        </div>
        <div className={s.settingsDetail}>
          <div><input type='checkbox' className={s.custom-checkbox} /> <label>Uppercase</label></div>
          <div><input type='checkbox' className={s.custom-checkbox} /> <label>Lowercase</label></div>
          <div><input type='checkbox' className={s.custom-checkbox} /> <label>Numbers</label></div>
          <div><input type='checkbox' className={s.custom-checkbox} /> <label>Symbols</label></div>
        </div>
      </div>

    </div >
  );
}

export default App;
